INSERT INTO `recetas` (`no_rec`, `nombre`, `ingredientes`, `prepara`, `cost`, `imagen`) VALUES
(3, 'Pozole rojo', '1 kilo de maíz pozolero precocido\r\n1 cabeza de ajo\r\nSal al gusto\r\n1 kilo de carne de puerco, cortada en cubos\r\n1 jitomate grande\r\n100 gramos de chile mirasol (guajillo)\r\n1/4 cucharadita de orégano\r\n1 pizca de cominos\r\n1 diente de ajo\r\nPara servir\r\n1 lechuga romana, picada\r\n1 cebolla pequeña, picada\r\n4 limones, en mitades\r\nTostadas de maíz', '1.Coloca el maíz en una olla grande, cubre con agua, agrega 1 cabeza de ajo y sal al gusto y cocina a fuego medio durante 2 horas.\r\n2.Después de ese tiempo, agrega la carne a la olla y cocina durante 1 hora o hasta que la carne esté bien suave. Desecha la cabeza de ajo.\r\n3.Mientras, hierve el jitomate hasta que se haya ablandado. Remoja los chiles en agua caliente hasta que estén suaves, quítales las semillas y el rabo y muélelos junto con el jitomate, sal, orégano, cominos y 1 diente de ajo. Cuela.\r\n4.Cuando ya está suave la carne, sácala de la olla y deshébrala.\r\n5.Vierte la salsa roja dentro de la olla con el maíz y deja que suelte el hervor. Regresa la carne deshebrada a la olla, rectifica la sazón y deja que hierva unos minutos más antes de servir.\r\n6.Sirve con lechuga picada, cebolla picada y unas gotas de jugo de limón. Acompaña con tostadas.', '80', );
INSERT INTO `recetas` (`no_rec`, `nombre`, `ingredientes`, `prepara`, `cost`, `imagen`) VALUES
(7, 'Caldo Tlalpeño', '1 kg costilla de res para cocer\r\n2 elotes\r\n2 zanahorias\r\n2 papas\r\n2 calabazas\r\n3 jitomate\r\n4 chiles guajillos\r\n1/2 cebolla\r\n4 dientes ajo\r\nUnas ramas de epazote\r\nCantidad necesaria Sal', '1-Cocer la carne en la olla de presión con 1/4 de cebolla, 2 dientes de ajo y sal por 40 minutos.\r\n2-Pelar y cortar las papas en cuadros, las zanahorias y las calabazas en tiras, y los elotes en 3 partes cada uno. Mientras se cuece la carne, cocer éstos en agua, empezando con los elotes, después las zanahorias, las papas y al final las calabazas. Dejando cocer un poco cada uno antes de agregar el siguiente.\r\n3-Quitar a los chiles las semillas y poner a cocer con los jitomates, cebolla y ajo.\r\n4-Moler y colar el chile, sazonar en un poco de aceite.\r\n5-Ya que está cocida la carne incorporar a la verdura cocida, junto con el caldo en que se coció\r\n6-Agregar el chile ya sazonado y las ramas de epazote. Dejar hervir otros 15 minutos.\r\n7-Servir y aderezar con limón.\r\n', '50', );
INSERT INTO `recetas` (`no_rec`, `nombre`, `ingredientes`, `prepara`, `cost`, `imagen`) VALUES
(9, 'Sopa Azteca de Tortilla', '•8 tortillas, cortadas en tiras y fritas\r\n•1 cucharada de aceite\r\n•2 jitomates\r\n•½ cebolla chica\r\n•2 dientes de ajo\r\n•8 tazas de caldo de pollo\r\n•1 rama de epazote\r\n•Para servir\r\n•2 chiles pasilla, desvenados y despepitados\r\n•1 aguacate, pelado y en rebanadas\r\n•Queso rallado tipo Chihuahua\r\n•Crema, al gusto\r\n•Sal, al gusto\r\n•1 cucharada de aceite', '1.Coloca los jitomates en una cacerola, cúbrelos con agua y deja que hiervan. Cocina a fuego medio hasta que los jitomates estén suaves, pero no deshaciéndose, entre 5 y 8 minutos. Licúalos junto con la cebolla y los ajos. Cuélalos.\r\n2.Calienta 1 cucharada de aceite en una olla a fuego medio y vierte dentro de ésta la mezcla anterior. Cocina hasta que se sazone y se reseque.\r\n3.Agrega el caldo, epazote y sal, y deja que suelte el hervor. Reduce la flama y hierve a fuego suave durante 3 minutos más.\r\n4.Mientras, calienta 1 cucharada de aceite en un sartén chico a fuego medio. Dora los chiles rápidamente cuidando que no se quemen. Desbarátalos con tus manos.\r\n5.Sirve la sopa caliente y adorna con chile pasilla, tiritas de tortilla, aguacate, queso y crema.', '58', );
INSERT INTO `recetas` (`no_rec`, `nombre`, `ingredientes`, `prepara`, `cost`, `imagen`) VALUES
(13, 'Enchiladas Suizas', '•250 gr pechuga de pollo\r\n•12 tortillas de maíz\r\n•250 gr queso chihuahua rallado\r\n•1 cebolla\r\n•1 media crema\r\n•2 chiles pasilla\r\n•3 chiles colorados\r\n•2 cda aceite\r\n•1 tza aceite\r\n•Al gusto Ajo\r\n•Al gusto Orégano\r\n•Al gusto Sal y pimienta', '1.Pon a cocer la pechuga de pollo en agua con sal, orégano y ajo al gusto. Ya que esté listo desmenuza y reserva.\r\n2.En una sartén honda y pequeña pon a hervir un poco de agua como para apenas cubrir los chiles e hidrátalos ahí con un poco de ajo. Ya que estén bien hidratados licúa con el ajo y un poco del caldo donde se hidrataron. Reserva.\r\n3.En una sartén agrega la taza de aceite y pon a freír las 12 tortillas. Reserva.\r\n4.En una sartén agrega 2 cda de aceite y sofríe ajo a tu gusto ya que se esté desintegrando antes de que se queme agrega la cebolla picada (reserva una poca de cebolla para más adelante) y sofríe bien hasta que transparente.\r\n5.Agrega los chiles licuados e integra bien. Deja hervir un poco y luego apaga. Para que enfríe un poco.\r\n6.Revuelca las tortillas fritas en el chile frito por los dos lados cubriéndolas bien coloca en un plato refractario y coloca un poco de pollo, cebolla picada y queso chihuahua elaborando un taco y así hasta utilizar las 12 tortillas coloca todos los tacos de pollo y queso en orden sobre el refractario y agrega algo de queso arriba de ellos hasta cubrir bien o a tu gusto.\r\n7.Introdúcelas en el horno previamente precalentado a 200 °C hasta que el queso este totalmente gratinado y doradito en la parte de arriba. Puedes utilizar el horno de microondas si no tienes horno convencional pero este último dora y el primero no.\r\n8.Sirve y decora con un poco de media crema.\r\n9.El chile lo pueden preparar de dos tipos como lo explico aquí o de la misma forma que preparo el chile para las albóndigas en chipotle si hacen albóndigas con el chile sobrante pueden preparar al día siguiente unas enchiladas o chilaquiles.', '60', );
INSERT INTO `recetas` (`no_rec`, `nombre`, `ingredientes`, `prepara`, `cost`, `imagen`) VALUES
(15, 'Entomatado', '•1 kg tomates verdes\r\n•5 dientes ajo medianos\r\n•1 cebolla mediana\r\n•3 chiles chipotles de lata\r\n•100 gr. Chorizo\r\n•1 kg chambarete de res (puede ser pollo, pero lo ideal es que sea la carne mencionada)\r\n•Al gusto sal\r\n•Aprox. 2 onzas de aceite comestible canola, soya, cartamo, oliva, etc', '1.Se pone a cocer el chambarete en olla express, 25 minutos, pueden agregarle un tuétano con todo y hueso mejor, agregar media cebolla adicional y sal al gusto.\r\n2.Mientras el cocido se realiza, tendremos el tiempo para picar en el orden siguiente: cebolla, ajos y tomates, todos estos por separado y en cortes cuadriculados y pequeños.\r\n3.En una cacerola o coludo que calculemos que puedan caber todos nuestros ingredientes y poder moverlos fácilmente, colocaremos el aceite, cuando este caliente,\r\n4.Iremos agregando en el mismo orden de corte nuestros ingredientes, cebolla, ajos y tomates.\r\n5.Chequearemos que todos estos estén acitronados (que hayan cambiado de color, más transparente) para que después, agreguemos el chorizo en cortes pequeños, seguido de los chipotles para que todo este sazonado al mismo tiempo.\r\n6.Agregaremos la carne, y en caso de estar muy espeso podremos agregar de el mismo caldo de la carne para darle la consistencia de espesor de nuestro agrado, esperar que hierva un poco y agregar salsa a nuestro gusto.\r\n7.Se sirve y en verdad les aconsejo que si gustan lo acompañen con frijoles de la olla.', '70', );
INSERT INTO `recetas` (`no_rec`, `nombre`, `ingredientes`, `prepara`, `cost`, `imagen`) VALUES
(17, 'Margarita', '1 litro de jugo fresco de mandarina\n6 caballitos de tequila blanco\n2 caballitos de miel de agave\nHielo', '1-Licua todos los ingredientes hasta triturar el hielo y alcanzar un punto frappé. Vierte sobre copas individuales y disfruta.', '220', ),
(19, 'Martini de vodka y manzana', '2 cucharadas de licor de manzana\n2 cucharadas de vodka\n2 cucharadas de jugo de manzana', '1-En una coctelera llena de hielo, combina el licor de manzana, vodka y el jugo de manzana. Agita bien. Vierte dentro de copas cocteleras y decora con una rebanada de manzana.', '250', );
INSERT INTO `recetas` (`no_rec`, `nombre`, `ingredientes`, `prepara`, `cost`, `imagen`) VALUES
(21, 'Vampiros', '1 caballito de tequila blanco\n2 caballitos de sangrita\n1 caballito de squirt\n1/2 limón sin semilla\n1 pizca de sal\nTajín en polvo\nHielo', '1-Pon el hielo an un vaso jaibolero escarchado con tajín en polvo. Agrega el tequila, sangrita, squirt, jugo de limón y una pizca de sal. Revuelve bien y toma con responsabilidad.', '70', ),
(23, 'Ginebra tonic', '4 cubitos de hielo\n60 ml de ginebra\n120 ml de agua mineral\n1 cucharada de jugo de limón fresco\n1 rodaja de limón para decorar', '1-Coloca los cubitos de hielo en un vaso jaibolero. Agrega la ginebra, el agua mineral y, finalmente, el jugo de limón. Mezcla bien con una cuchara larga.\n2-Decora con 1 rodaja de limón y sirve inmediatamente.', '300', );

